import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import HomePage from "./components/HomePage/HomePage"; // Chemin vers HomePage
import UploadPage from "./components/UploadPage/UploadPage"; // Chemin vers UploadPage

const App = () => {
  return (
    <Router>
      <Routes>
        {/* Route vers la page d'accueil */}
        <Route path="/" element={<HomePage />} />

        {/* Route vers la page d'upload */}
        <Route path="/upload" element={<UploadPage />} />
      </Routes>
    </Router>
  );
};

export default App;
